import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<nav class="navbar bg-body-tertiary">
  <div class="container-fluid">
    <a class="navbar-brand">first-page</a>
    <form class="d-flex" role="search">
      <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search">
      <button class="btn btn-outline-success" type="submit"> <a routerLink="/login" class="text-primary" style="cursor : pointer">l</a>Login</button>
      <button class="btn btn-outline-success" type="submit">Signup</button>
      <button class="btn btn-outline-success" type="submit">Logout</button>
    </form>
  </div>
</nav>
